import React from "react"; 
import {Btn, Container,HeadTitle,Inputtype,Textcontainer,Div} from './style'

class Buttons extends React.Component{
      render(){
        return(
            <Container>
                

              <Textcontainer>

               <HeadTitle>Login</HeadTitle>
               <HeadTitle color="#46a358">Register</HeadTitle>
               <HeadTitle>Enter your username and password to login.</HeadTitle>
                  <Div>
                  <Inputtype placeholder="enter username"></Inputtype>
                   <Inputtype type ='password' placeholder="enter your password" ></Inputtype>
                   <HeadTitle>Forgot Password? </HeadTitle>
                   </Div>

                  <Btn>Login</Btn>
              </Textcontainer>

              
            </Container>
        )
      }
}
export default Buttons
